import Vue from 'vue';
import Router from 'vue-router';
import Account from './components/Account.vue';
import Personal from './components/Personal.vue';
import PersonalForm from './components/PersonalForm.vue';
import Service from './components/Service.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/',
      redirect: '/account',
    },
    {
      path: '/account',
      name: 'account',
      component: Account,
      meta: { title: 'Account Info' },
    },
    {
      path: '/personal',
      component: Personal,
      meta: { title: 'Personal Info' },
      children: [
        {
          path: '',
          component: PersonalForm,
        },
        {
          path: 'avatar',
          meta: { title: 'Change avatar' },
          component: () => import('./components/PersonalAvatar.vue'),
        },
      ],
    },
    {
      path: '/service',
      name: 'service',
      meta: { title: 'Personal Service' },
      component: Service,
    },
  ],
});
